import { useSelector } from "react-redux";

function Mybalance() {

    const balance = useSelector((state) => state.totMoney.value);  //prints money received in top comp 

    return ( 
        <div>
        <span className="">Total received</span>
            <div>{balance}</div>
        </div>
     );
}

export default Mybalance;
